import React from 'react';
import { createStackNavigator } from '@react-navigation/stack';
import HomeScreen from './screens/homeScreen';
import Movie from './movie';
import SortedDisplay from './screens/sortedDisplay';
import AddItem from './addItem';

const HomeStack = createStackNavigator();
const LibraryStack = createStackNavigator();
const AddItemStack = createStackNavigator();

const Home = () => {
    return (
        <HomeStack.Navigator
            initialRouteName="Home View"
            screenOptions={{
                headerStyle: {
                    backgroundColor: '#404040',
                    borderBottomWidth: 0
                },
                headerTintColor: '#00C6CF',
                headerTitleStyle: {
                    fontSize: 38,
                    fontWeight: 'bold',
                    textAlign: 'center'
                },
            }}
        >
            <HomeStack.Screen component={HomeScreen} name="Home View" options={{ title: 'Movie Library' }} />
            <HomeStack.Screen component={Movie} name="Movie Details" options={({ route }) => ({ title: route.params.movieDetails.title })} />
            <HomeStack.Screen component={SortedDisplay} name="Library" />
        </HomeStack.Navigator>
    );
};

export const Library = () => {
    return (
        <LibraryStack.Navigator
            initialRouteName="Library"
            screenOptions={{
                headerStyle: {
                    backgroundColor: '#404040',
                    borderBottomWidth: 0
                },
                headerTintColor: '#00C6CF',
                headerTitleStyle: {
                    fontSize: 38,
                    fontWeight: 'bold',
                    textAlign: 'center'
                },
            }}
        >
            <LibraryStack.Screen component={SortedDisplay} name="Library" />
            <LibraryStack.Screen component={Movie} name="Movie Details" options={({ route }) => ({ title: route.params.movieDetails.title })} />
        </LibraryStack.Navigator>
    );
};

export const Add = () => {
    return (
        <LibraryStack.Navigator
            initialRouteName="Add"
            screenOptions={{
                headerStyle: {
                    backgroundColor: '#404040',
                    borderBottomWidth: 0
                },
                headerTintColor: '#00C6CF',
                headerTitleStyle: {
                    fontSize: 38,
                    fontWeight: 'bold',
                    textAlign: 'center'
                },
            }}
        >
            <LibraryStack.Screen component={AddItem} name="Add" />
            <LibraryStack.Screen component={Movie} name="Movie Details" options={({ route }) => ({ title: route.params.movieDetails.title })} />
        </LibraryStack.Navigator>
    );
};

export default Home;
